import React from "react";
import './styles/Header.css'

const Header = function(){
    return(
        <header>
            <logo></logo>
            <nav>
                <ul>
                    <li><a>GameSpace</a></li>
                    <li><a>Shop</a></li>
                    <li><a>Library</a></li>
                    <li><a>Report</a></li>
                </ul>
            </nav>
            <button />Login
        </header>
    );
}

export default Header;
